import React from 'react';
import {FooterSection , FooterDesc} from './style.js';
const Footer =() => {
  return (
    <div >
          <FooterSection class="footer">
            <FooterDesc> copyright &copy; 2018 by ultra profile </FooterDesc>
          </FooterSection>
    </div>
  );
}

export default Footer;
